const ReusableSvg = ({ bannerSvgName, fillColor = 'black', width = 24, height = 24 }) => {
  const svgContent = svgMarkup[bannerSvgName]
    ? svgMarkup[bannerSvgName](fillColor)
    : svgMarkup.default(fillColor);

  return <SvgXml xml={svgContent} width={width} height={height} />;
};

export default ReusableSvg;
